import s from './Dialogs.module.css';
import {NavLink} from "react-router-dom";

const DialogItem = (props) => {
    return(
        <div className={s.dialog}>
            <NavLink to={"/dialogs/"+ props.id}>{props.name}</NavLink>
        </div>
    )
}
const Message = (props) => {
    return (
        <div className={s.massage}>{props.message}</div>
    )
}

let dialogsData = [
    {id: 1, name: 'Dimych'},
    {id: 2, name: 'Andrey'},
    {id: 3, name: 'Sveta'},
    {id: 4, name: 'Sasha'},
    {id: 5, name: 'Victor'},
    {id: 6, name: 'Valera'}
]
let messagesData = [
    {id: 1, massage: 'Hi'},
    {id: 2, massage: 'How are u'},
    {id: 3, massage: 'Yo'},
    {id: 5, massage: 'Yo'},
    {id: 5, massage: 'You'},
]
const Dialogs = () => {
    return(
        <div className={s.dialogs}>
            <div className={s.dialogsItems}>
                {
                    dialogsData.map(d =>
                        <DialogItem name={d.name} id={d.id}/>
                    )
                }
            </div>
            <div className={s.messages}>
                {
                    messagesData.map(m =>
                        <Message message={m.massage}/>
                    )
                }
            </div>
        </div>
    )
}

export default Dialogs;
